import React from 'react'
import Cards from '../Ul/Cards';
import classes from '../User/UserList.module.css'; 
const UserList = (props) =>{
  return (
    <Cards>
    <ul>
      {
        props.items.map(list =>
          <li key={list.id}>
            {list.name} 
            ({list.age} years old)
           
          </li>)
      }
    </ul>
    </Cards>
  )
}

export default UserList
